/**
 * @swagger
 * components:
 *   schemas:
 *     User:
 *       type: object
 *       required:
 *         - name
 *         - email
 *         - password
 *         - role
 *       properties:
 *         _id:
 *           type: string
 *           description: Auto-generated MongoDB ID
 *           example: "507f1f77bcf86cd799439011"
 *         name:
 *           type: string
 *           description: User's full name
 *           example: "John Doe"
 *         email:
 *           type: string
 *           format: email
 *           description: User's email address
 *           example: "john@example.com"
 *         phone:
 *           type: string
 *           description: User's phone number
 *           example: "+84901234567"
 *         role:
 *           type: string
 *           enum: [customer, restaurant, delivery, admin]
 *           description: User's role in the system
 *           example: "customer"
 *         isApproved:
 *           type: boolean
 *           description: Whether user is approved (for restaurant/delivery)
 *           example: true
 *         isActive:
 *           type: boolean
 *           description: Whether user account is active
 *           example: true
 *         addresses:
 *           type: array
 *           items:
 *             $ref: '#/components/schemas/Address'
 *         createdAt:
 *           type: string
 *           format: date-time
 *         updatedAt:
 *           type: string
 *           format: date-time
 * 
 *     Address:
 *       type: object
 *       properties:
 *         _id:
 *           type: string
 *         label:
 *           type: string
 *           example: "Home"
 *         street:
 *           type: string
 *           example: "123 Main Street"
 *         city:
 *           type: string
 *           example: "Ho Chi Minh City"
 *         state:
 *           type: string
 *           example: "HCM"
 *         zipCode:
 *           type: string
 *           example: "70000"
 *         country:
 *           type: string
 *           example: "Vietnam"
 *         isDefault:
 *           type: boolean
 *           example: true
 *         coordinates:
 *           type: object
 *           properties:
 *             lat:
 *               type: number
 *               example: 10.8231
 *             lng:
 *               type: number
 *               example: 106.6297
 * 
 *     RegisterRequest:
 *       type: object
 *       required:
 *         - name
 *         - email
 *         - password
 *         - role
 *       properties:
 *         name:
 *           type: string
 *           minLength: 2
 *           maxLength: 50
 *           example: "John Doe"
 *         email:
 *           type: string
 *           format: email
 *           example: "john@example.com"
 *         password:
 *           type: string
 *           minLength: 6
 *           example: "password123"
 *         phone:
 *           type: string
 *           example: "+84901234567"
 *         role:
 *           type: string
 *           enum: [customer, restaurant, delivery]
 *           example: "customer"
 * 
 *     LoginRequest:
 *       type: object
 *       required:
 *         - email
 *         - password
 *       properties:
 *         email:
 *           type: string
 *           format: email
 *           example: "john@example.com"
 *         password:
 *           type: string
 *           example: "password123"
 * 
 *     AuthResponse:
 *       type: object
 *       properties:
 *         success:
 *           type: boolean
 *           example: true
 *         message:
 *           type: string
 *           example: "Login successful"
 *         token:
 *           type: string
 *           description: JWT access token
 *           example: "eyJhbGciOiJIUzI1NiIsInR5cCI6IkpXVCJ9..."
 *         refreshToken:
 *           type: string
 *           description: JWT refresh token
 *           example: "eyJhbGciOiJIUzI1NiIsInR5cCI6IkpXVCJ9..."
 *         user:
 *           $ref: '#/components/schemas/User'
 * 
 *     ForgotPasswordRequest:
 *       type: object
 *       required:
 *         - email
 *       properties:
 *         email:
 *           type: string
 *           format: email
 *           example: "john@example.com"
 * 
 *     ResetPasswordRequest:
 *       type: object
 *       required:
 *         - password
 *       properties:
 *         password:
 *           type: string
 *           minLength: 6
 *           example: "newpassword123"
 * 
 *     ChangePasswordRequest:
 *       type: object
 *       required:
 *         - currentPassword
 *         - newPassword
 *       properties:
 *         currentPassword:
 *           type: string
 *           example: "oldpassword123"
 *         newPassword:
 *           type: string
 *           minLength: 6
 *           example: "newpassword123"
 */

